                empid:empid
              },
                { headers: { Authorization: token() } }
            )
        .then((response) => {
            console.log(response);
            qrCodeValue.value = response.data
            console.log(qrCodeValue)
        })
        .catch((error) => {
            console.error('An error occurred:', error);
        });
} catch (error) {
    console.error('An error occurred:', error);
}
}

const fetchEmployee = (id) => {

  axios.post(URL()+`/employee`,{
        
        'requestType':'view',
        'staff_id': id,
       
      
